import React from 'react';
import '../assets/style/components/.scss';
import Header from '../components/Header';
import Search from '../components/Search';
import Footer from '../components/Footer';


const App = () => (
    <div className="App">
        <Header/>
        <Search/>
        <Footer/>
        
    </div>
);
export default App;
